        List<BigDecimal> invoices = Arrays.asList(new BigDecimal("68.1"), new BigDecimal("18.7"), new BigDecimal("14.7"), new BigDecimal("75.9"), new BigDecimal("58.1"), new BigDecimal("71.8"), new BigDecimal("12.5"), new BigDecimal("54.0"), new BigDecimal("35.6"), new BigDecimal("70.0"), new BigDecimal("29.4"), new BigDecimal("61.1"), new BigDecimal("56.2"), new BigDecimal("48.9"), new BigDecimal("42.8"), new BigDecimal("77.4"), new BigDecimal("81.1"), new BigDecimal("34.5"), new BigDecimal("23.7"), new BigDecimal("90.6"));
